INSERT INTO `oc_task_script` VALUES (1,'init_system_ecs','初始化系统(ecs)',0,'liangjian','#!/bin/bash\n\n# 修改DNS\n/usr/local/prometheus/bin/system/chg_dns 10.117.179.184 10.24.239.232\n# 更新框架\n/usr/local/prometheus/bin/update\n# 初始化数据盘并挂载\n/usr/local/prometheus/bin/system/auto_fdisk_x\n# 安装abbix_agentd\n/usr/local/prometheus/bin/system/install_zabbix_proxy3',0,1,'2018-05-22 10:51:29','2018-06-07 09:02:51'),(2,'install_tomcat','安装tomcat',0,'liangjian','#!/bin/bash\n\n# 安装tomcat\n/usr/local/prometheus/bin/install_tomcat -a',0,1,'2018-05-22 10:54:47','2018-06-07 09:02:52'),(3,'prometheus_update','更新框架',0,'liangjian','#!/bin/bash\n\nif [  -f \'/usr/local/prometheus/bin/update\'  ]  ;  then\n  /usr/local/prometheus/bin/update\n  exit 0\nfi\n\nif [  -f \'/usr/local/prometheus/bin/prometheus_update\'  ]  ;  then\n  /usr/local/prometheus/bin/prometheus_update  >/dev/null 2>&1\n  exit 0\nfi',0,1,'2018-05-23 03:06:15','2018-06-13 08:10:22'),(4,'nginx_cleanup_logs','清理nginx日志',0,'liangjian','#!/bin/bash\n\nRETENTION_LOG_DAY=$1\n\nif [[  \".\" ==  \".${RETENTION_LOG_DAY}\"  ]]; then\n   RETENTION_LOG_DAY=5\nfi\n\nfunction delLogs(){\n  local logPath=$1\n  local logType=$2\n  logPath=`dirname ${logPath}`\n  find ${logPath} -mtime +${RETENTION_LOG_DAY} -type f -name ${logType} -exec rm -f {} \\;\n  #find ${logPath} -mtime +${RETENTION_LOG_DAY} -type f -name *access.log.*.log -exec rm -f {} \\;\n}\n\ndelLogs /data/www/logs/ \'*access.log.*.log\' ;\ndelLogs /data/www/logs/ \'*error.log.*.log\' ;',0,1,'2018-05-23 05:14:05','2018-06-07 09:02:53'),(5,'install_logtail','安装阿里云日志采集服务logtail',0,'liangjian','#!/bin/bash\n\nwget http://logtail-release-cn-hangzhou.oss-cn-hangzhou-internal.aliyuncs.com/linux64/logtail.sh -O logtail.sh; chmod 755 logtail.sh; ./logtail.sh install cn-hangzhou',0,1,'2018-05-24 05:19:20','2019-01-14 08:06:32'),(7,'getway_set_login','配置Getway登录限制（系统内置命令请勿修改）',0,'liangjian','# 参数说明\n# 指定getway命令路径 -p=/data/www/getway/users \n\nfunction doParam(){\n  local param=\n  [ $# == 0 ] && return ;\n  for param in \"$@\" ; do\n      local paramName=`echo ${param} | awk -F\'=\' \'{print $1}\'`\n      local paramValue=`echo ${param} | awk -F\'=\' \'{print $NF}\'`\n      case \"${paramName}\" in\n          -p)\n              GETWAY_USER_CONF_PATH=${paramValue} ;;\n      esac\n  done\n}\n\n\nGETWAY_USER_CONF_PATH=/data/www/getway/users\n\ndoParam $@ ;\necho $@\n\ncat << EOF >> /etc/profile\n# Getway Login\ncase \"\\${USER}\" in\n       root|admin|manage|xqadmin)\n          ;;\n       *)\n          echo \"Welcome \\$USER\"\n          ${GETWAY_USER_CONF_PATH}/../getway ;;\nesac\nEOF\n\ntail -n 8 /etc/profile',0,1,'2018-06-06 08:24:19','2018-06-13 06:07:12'),(8,'getway','getway源码（系统内置，不要删除）',0,'liangjian','#!/bin/bash\n\n#===============================================================================\n#   SYSTEM REQUIRED:  Linux Centos6\n#   DESCRIPTION:  ssh server\n#   AUTHOR: Liang jian\n#   QQ:  80327044\n#===============================================================================\n# 2016-11-23\n# 新增 按d进入daily服务器 按g进入gray\n# 2017-10-23\n# 新增 getway登陆统计\n\nfunction config(){\n  #-------配置项--------------------------\n  DEBUG_FILE_NAME=$(basename $0).log\n  # 加载函数\n  # test \".${PROM_HOME}\" = . && PROMETHEUS_HOME=/usr/local/prometheus\n  # if [ -r \"${PROM_HOME}/funcs/funcs\" ] ; then\n  #   . ${PROM_HOME}/funcs/funcs\n  # else\n  #   echo \"${PROM_HOME}/funcs/funcs not found\"\n  #   exit_logout ;\n  # fi\n  # 业务服务器通用账户\n  SERVER_LOGIN=manage\n  # ctrl+c滚动\n  stty eof ^C\n  # 禁止中断 ctrl+c\n  trap \'\' INT\n  # stty intr undef\n  # 支持退格\n  # stty erase ^H\n  # 加载用户配置文件\n  # 用户目录\n  GETWAY_USER_CONF_PATH=\'/data/www/getway/users\'\n  #loadConf \"/data/www/getway/$USER/getway.conf\"\n  #loadConf \"/data/www/getway/.public/getway_host.conf\"\n  #SSHS_TMP_FILE=\"`head -1 /dev/urandom |md5sum | awk \'{print $1}\'`.sshs.tmp\"\n\n  #登录统计接口\n  CMDB_GETWAY_STATUS_API=\"http://opscloudSever/box/getway/status\"\n\n  GETWAY_VERSION=\"1.0.1 2016-11-23\"\n  HOSTGROUP=\n  HOSTIP=\n\n  # 计算配置行\n  HOSTGROUP_OPT_CNT=$(( ${#HOSTGROUP_OPT[*]} / 3 ))\n  HOST_OPT=\n  HOST_OPT_CNT=\n  DIVIDING_LINE=\"----------------------------------------------------------------------------------------------------------\"\n}\n\n\nfunction doParam(){\n  local param=\n  [ $# == 0 ] && return ;\n  for param in \"$@\" ; do\n      local paramName=`echo ${param} | awk -F\'=\' \'{print $1}\'`\n      local paramValue=`echo ${param} | awk -F\'=\' \'{print $NF}\'`\n      case \"${paramName}\" in\n          -i)\n              install_getway ;;\n      esac\n  done\n  test \".${LOGIN_USER}\" = . && exit 1 ;\n}\n\nfunction echoPlus(){\n  # 增强显示\n  # @param color  (31|91 红  32|92绿  33|93黄 34|94蓝 35|95紫 36|96天蓝)\n  # @param content\n  local colorCode=$1\n  local content=$2\n  case ${colorCode} in\n    31|91|error|err)\n            colorCode=31\n            debug [ERROR] ${content} ;;\n    32|92|info)\n            colorCode=32 \n            ## debug [INFO] ${content} \n            ;; \n  esac\n  IFS=$\'\\t\\n\'\n  #test  \".`pwd`\" = \"./home/xqadmin\" && echo \"${content}\" && return\n  echo -e \"\\e[${colorCode}m${content}\\e[0m\"\n}\n\n\n\nfunction reload_conf(){\n    . \"${GETWAY_USER_CONF_PATH}/$USER/getway.conf\" ;\n    . \"${GETWAY_USER_CONF_PATH}/.public/getway_host.conf\" ;\n    HOSTGROUP_OPT_CNT=$(( ${#HOSTGROUP_OPT[*]} / 3 ))\n}\n\n#----------通用----------\nfunction acq_hostgroup_value(){\n  local name=$1\n  local returnType=$2\n  local index=`acq_hostgroup_index_by_name ${name}`\n  local value=`acq_hostgroup_opt ${returnType} ${index}`\n  echo ${value}\n}\n\nfunction acq_hostgroup_index_by_name(){\n  local name=$1\n  local i\n  for((i=0;i<${HOSTGROUP_OPT_CNT};i++));do\n     if [ ${name} == `acq_hostgroup_opt name $i` ] ; then\n        echo $i ;\n        break ;\n     fi\n  done\n}\n\nfunction acq_hostgroup_opt(){\n  # 提取 JAVA_PROJECTS_OPT 中的矩阵数据\n  # @param project_name:host_group:environmental:properties\n  # @param index\n  # return file or key or value\n  local getType=$1\n  local index=$2\n  IFS=$\'\\n\\t\'\n  case \"${getType}\" in\n       name)\n          index=$(( ${index} * 3 ))     ;;\n       content)  \n          index=$(( ${index} * 3 + 1 )) ;;\n       color)\n          index=$(( ${index} * 3 + 2 )) ;;\n  esac\n  echo ${HOSTGROUP_OPT[${index}]}\n}\n\nfunction acq_host_value(){\n  local name=$1\n  local returnType=$2\n  local index=`acq_host_index_by_name ${name}`\n  local value=`acq_host_opt ${returnType} ${index}`\n  echo ${value}\n}\n\nfunction acq_host_index_by_name(){\n  local name=$1\n  local i\n  for((i=0;i<${HOST_OPT_CNT};i++));do\n     if [ ${name} == `acq_host_opt ip $i` ] ; then\n        echo $i ;\n        break ;\n     fi\n  done\n}\n\nfunction acq_host_opt(){\n  # 提取 JAVA_PROJECTS_OPT 中的矩阵数据\n  # @param ip:hostname:hostgroup:environmental:login\n  # @param index\n  # return file or key or value\n  local getType=$1\n  local index=$2\n  IFS=$\'\\n\\t\'\n  case \"${getType}\" in\n       ip)\n          index=$(( ${index} * 5 ))     ;;\n       hostname)  \n          index=$(( ${index} * 5 + 1 )) ;;\n       hostgroup)\n          index=$(( ${index} * 5 + 2 )) ;;\n       environment)\n          index=$(( ${index} * 5 + 3 )) ;;\n       login)\n          index=$(( ${index} * 5 + 4 )) ;;\n  esac\n  echo ${HOST_OPT[${index}]}\n}\n\n#----------通用----------\n\nfunction print_format_hostgroup(){\n  # 增强显示\n  # @param index\n  # @param name\n  # @param content\n  # @param color\n  local index=$1\n  local name=$2\n  local content=$3\n  local color=$4\n  IFS=$\'\\n\\t\'\n  if [ $# == 0 ] ; then\n     printf \"\\e[32m%-15s %-25s %-25s\\e[0m\\n\" ID NAME CONTENT\n  else\n     printf \"%-15s \\e[${color}m%-25s\\e[0m %-25s\\n\" $index $name $content\n  fi\n}\n\nfunction echo_hostgroup(){\n  local i name content color index\n  echo $DIVIDING_LINE\n  print_format_hostgroup ;\n  echo $DIVIDING_LINE\n  for((i=0;i<${HOSTGROUP_OPT_CNT};i++)) ;do\n     name=${HOSTGROUP_OPT[$(( $i * 3 ))]}\n     content=`acq_hostgroup_value $name content`\n     color=`acq_hostgroup_value $name color`\n     index=$(( $i + 1 ))\n     print_format_hostgroup ${index} ${name} ${content} ${color} ;\n  done\n  echo $DIVIDING_LINE\n}\n\nfunction select_hostgroup(){\n  local name\n  while true\n  do\n    echo_hostgroup ;\n    unset hostgroup_id\n    read -p \"please select hostgroup id: \" hostgroup_id\n    case \"${hostgroup_id}\" in\n          r|l) reload_conf ;;\n    esac\n    test `is_numbers ${hostgroup_id}` = 0 && continue ;\n    if [ \"${hostgroup_id}\" -ge \"1\" ] && [ \"${hostgroup_id}\" -le \"${HOSTGROUP_OPT_CNT}\" ];then\n       name=${HOSTGROUP_OPT[$(( ( ${hostgroup_id} - 1 ) * 3 ))]}\n       echo -e \"You select hostgroup : \\e[32m$name\\e[0m\"\n       HOSTGROUP=${name}\n       # 赋值被选中的主机组\n       local hostgroup_name=`eval echo \"$\\{\"\"HOSTGROUP_\"\"${HOSTGROUP}\"\"[*]\\}\"`\n       IFS=$\' \\n\\t\'\n       HOST_OPT=( `eval echo $hostgroup_name` )\n       HOST_OPT_CNT=$(( ${#HOST_OPT[*]} / 5 ))\n       select_host ;\n    else\n       echo \"The wrong choice !\" ;\n    fi\n  done  \n}\n\nfunction echo_host(){\n  local i index ip hostname hostgroup environment login\n  echo $DIVIDING_LINE\n  print_format_host ;\n  echo $DIVIDING_LINE\n  #[ -f \"/data/www/temp/sshs.tmp\" ] && rm -f /data/www/temp/${SSHS_TMP_FILE}\n  for((i=0;i<${HOST_OPT_CNT};i++)) ;do\n     ip=${HOST_OPT[$(( $i * 5 ))]}\n     hostgroup=`acq_host_value $ip hostgroup`\n     index=$(( $index + 1 ))\n     environment=`acq_host_value $ip environment`\n     hostname=`acq_host_value $ip hostname`\n     print_format_host $index $ip $environment $hostname\n  done\n  echo $DIVIDING_LINE\n}\n\nfunction print_format_host(){\n  # 增强显示\n  local index=$1\n  local ip=$2\n  local environment=$3\n  local hostname=$4\n  local color\n  IFS=$\'\\n\\t\'\n  if [ $# == 0 ] ; then\n     printf \"\\e[32m%-5s %-25s %-25s %-50s\\e[0m\\n\" ID IP ENVIRONMENT HOSTNAME/CONTENT\n  else\n     case \"${environment}\" in\n          production) color=31 ;;\n          gray) color=33 ;;\n          daily) color=32 ;;\n          *) color=0 ;;\n     esac\n     printf \"%-5s %-25s \\e[${color}m%-25s\\e[0m %-50s\\n\" $index $ip $environment $hostname\n  fi\n}\n\nfunction select_host_(){\n  local select_env=$1\n  # 快速进入daily/gray\n  local id=0\n  local ip environment\n  for((i=0;i<${HOST_OPT_CNT};i++)) ;do\n     ip=${HOST_OPT[$(( $i * 5 ))]}\n     id=$(( $id + 1 ))\n     environment=`acq_host_value $ip environment`\n     if [[  ${select_env} == ${environment} ]] ; then\n        echo $id\n        return ;\n     fi \n  done\n  echo 0 ;\n}\n\nfunction select_host(){\n  while true\n  do\n    unset host_id\n    echo_host ;\n    read -p \"please select host id: \" host_id\n    # 快速进入daily/gray服务器\n    case \"${host_id}\" in\n          d|daily) host_id=`select_host_ daily` ;;\n          g|gray)  host_id=`select_host_ gray` ;;\n          r|l)     reload_conf ;;\n    esac\n    test `is_numbers ${host_id}` = 0 && break ;\n    if [ \"${host_id}\" -ge \"1\" ] && [ \"${host_id}\" -le \"${HOST_OPT_CNT}\" ];then\n       local index=$(( ( $host_id - 1 ) * 5   ))\n       HOSTIP=${HOST_OPT[${index}]}\n       echo -e \"You select host_ip : \\e[32m$HOSTIP\\e[0m\"\n       # 统计接口 需要配置才能启用\n       # cmdb_getway_status $USER $HOSTIP;\n       ssh_host ;\n    else\n       echo \"The wrong choice !\";\n    fi\n  done  \n}\n\nfunction is_numbers(){\n  # 判断字符串是否为数字\n  # return 1  数字\n  # return 0  非数字\n  local numbers=$1\n  echo \"${numbers}\" | [ -n \"`sed -n \'/^[0-9][0-9]*$/p\'`\" ] && echo 1 || echo 0\n}\n\n\nfunction ssh_host(){\n  local login=`acq_host_value $HOSTIP login`\n  local login_type=`awk -F: \'{print $1}\' <<< $login`\n  local value=`awk -F: \'{print $NF}\' <<< $login`\n  case \"${login_type}\" in\n          KEY) \n             ssh_host_key $HOSTIP ;;\n          PASSWD) \n             [ \".${value}\" == \".\" ]\n             ssh_host_passwd $HOSTIP $value;;\n  esac\n}\n\nfunction exit_logout(){\n  # 严重错误发生则登出系统\n  logout ;\n}\n\n\nfunction ssh_host_passwd(){\n  local ip=$1\n  local passwd=$2\n  sshpass -C -p ${passwd} ssh -o StrictHostKeyChecking=no -o GSSAPIAuthentication=no root@$ip\n}\n\nfunction ssh_host_key(){\n  local ip=$1\n  if [ -f \"/home/$USER/.ssh/.secret_id_rsa\" ] ; then\n     ssh -C -o StrictHostKeyChecking=no -i /home/$USER/.ssh/.secret_id_rsa -o GSSAPIAuthentication=no ${SERVER_LOGIN}@$ip\n  else\n     ssh -C -o StrictHostKeyChecking=no -o GSSAPIAuthentication=no ${SERVER_LOGIN}@$ip\n  fi  \n}\n\nfunction getway_info(){\n  echo $DIVIDING_LINE\n  echoPlus info \"GetwayVersion : $GETWAY_VERSION\"\n  echoPlus 92 \"LonginUser : $CN    Name : $NAME    Email : $EMAIL\" ;\n}\n\nfunction cmdb_getway_status(){\n  # @param\n\n  local username=$1\n  local ip=$2\n\n  local param=\"username=${username}&ip=${ip}\"\n  echo \"User=${username};LoginServerIp=${ip}\" >> /data/www/logs/getway/getway.log\n  \n  curl --connect-timeout 3 -d \"${param}\" \"${CMDB_GETWAY_STATUS_API}\" >> /data/www/logs/getway/getway.log 2>&1\n  #curl -d \"username=liangjian&ip=10.17.1.124\"  \"http://opscloudserver.com/box/getway/status\"\n}\n\nfunction install_getway(){\n   if [ -r \"${GETWAY_USER_CONF_PATH}/../getway\" ] ; then\n      rm -f ${GETWAY_USER_CONF_PATH}/../getway\n   fi\n   echo \"Getway local path=$(dirname \"$0\")/$(basename $0)\"\n   \\cp $(dirname \"$0\")/$(basename $0) ${GETWAY_USER_CONF_PATH}/../getway\n   chmod +x ${GETWAY_USER_CONF_PATH}/../getway\n   exit 0;\n}\n\nconfig ;\ndoParam $@ ;\nreload_conf ;\ngetway_info ;\nselect_hostgroup ;',0,1,'2018-06-06 11:18:38','2018-06-08 06:09:39'),(9,'getway_account','getway授权命令（系统内置，不要删除）',0,'liangjian','#!/bin/bash\n\n#===============================================================================\n#   SYSTEM REQUIRED:  Linux Centos6\n#   DESCRIPTION:  System Account\n#   AUTHOR: Liang jian\n#   QQ:  80327044\n#   2015-03\n#===============================================================================\n\n# getway_account -u=liangjian -p=9f4975327825bb7fb42adff8066dd36f -kp=/data/www/getway/keys -up=/data/www/getway/users\n# 创建/修改账户 -u=账户 -p=密码\n# getway_account -d=liangjian\n# 删除账户 -d=账户\n\nfunction config(){\n\n  AUTH_KEY_NAME=authorized_keys\n  DEBUG_FILE_NAME=$(basename $0).log\n\n  GETWAY_KEY_PATH=/data/www/getway/keys\n  GETWAY_USER_CONF_PATH=/data/www/getway/users\n\n  #GETWAY_PATH=/data/www/getway\n  #KEY_PATH=/data/www/getway/key\n\n  LOGIN_USER=\n\n  # 留空随机生成128位长度密码\n  PASSWORD=\n\n}\n\nfunction doParam(){\n  local param=\n  [ $# == 0 ] && return ;\n  for param in \"$@\" ; do\n      local paramName=`echo ${param} | awk -F\'=\' \'{print $1}\'`\n      local paramValue=`echo ${param} | awk -F\'=\' \'{print $NF}\'`\n      case \"${paramName}\" in\n          -u|-user)\n              LOGIN_USER=${paramValue} \n             echo \"lOGIN_USER=\"${lOGIN_USER}\n             ;;\n          -p|-password)\n              PASSWORD=${paramValue} ;;\n          -d)\n              LOGIN_USER=${paramValue} \n              account_del ;;  \n          -kp)\n              GETWAY_KEY_PATH=${paramValue}\n               echo \"GETWAY_KEY_PATH=\"${GETWAY_KEY_PATH}\n              ;;\n          -up)\n              GETWAY_USER_CONF_PATH=${paramValue}\n              echo \"GETWAY_USER_CONF_PATH=\"${GETWAY_USER_CONF_PATH}\n              ;;  \n          -h|-help)\n              # prom_help $(basename $0) \n              exit 0 ;;\n      esac\n  done\n  test \".${LOGIN_USER}\" = . && exit 1 ;\n}\n\nfunction checkRoot(){\n  # 检查用户是否为root\n  if [ $(id -u) != \"0\" ]; then\n     echoPlus 31 \"Error: You must be root to run this script.\"\n     exit 1\n  fi\n}\n\nfunction acqRandomPassword(){\n  if [ \".${PASSWORD}\" == \".\" ] ; then\n     PASSWORD=`head -n 5 /dev/urandom | md5sum | awk \'{print $1}\'`\n  fi  \n  echo ${PASSWORD}\n}\n\nfunction execMkdir(){\n  # 创建目录\n  # @Param dir\n  local dir=$1\n  [ -d ${dir} ] || mkdir -p ${dir} >/dev/null 2>&1\n}\n\nfunction account_add(){\n  check ;\n  case \"${LOGIN_USER}\" in\n       root|xqadmin|manage|admin)\n          echo \"错误:不能创建管理员\" ;\n          exit 1 ;;\n  esac\n  # 判断用户是否存在，若存在只修改密码\n  local account_exist=`exists_user`\n  test $account_exist = 0 && useradd ${LOGIN_USER};\n  local passwd=`acqRandomPassword`\n  # echo \"password:${passwd}\"\n  #mkdir -p /data/www/temp\n  echo \"${passwd}\" | passwd --stdin \"${LOGIN_USER}\" >/dev/null 2>&1\n}\n\nfunction account_del(){\n  case \"${LOGIN_USER}\" in\n       root|xqadmin|manage|admin)\n          echo \"错误:不能删除管理员\" ;\n          exit 1 ;;\n  esac\n  # 判断用户是否存在，若存在只修改密码\n  local account_exist=`exists_user`\n  test $account_exist = 1 && userdel -r -f ${LOGIN_USER};\n  # echoPlus info \"remove user ${LOGIN_USER}\" ;\n  echo \"成功:\"`hostname`;\n  exit 0\n}\n\nfunction exists_user(){\n  # 判断用户是否存在\n  # 0:不存在\n  # 1:存在\n  # check user\n  id ${LOGIN_USER} >& /dev/null  \n  if [ $? -ne 0 ]; then  \n     echo 0\n  else\n     echo 1   \n  fi \n}\n\nfunction check(){\n  # 判断用户公钥是否存在，如果不存在则可用密码登陆\n  test -f ${GETWAY_KEY_PATH}/${LOGIN_USER}/${AUTH_KEY_NAME} || echo \"错误:公钥不存在\" ;\n  # 判断用户私钥是否存在，非必需\n  # test -f ${KEY_PATH}/${LOGIN_USER}/id_rsa || echoPlus info \"id_rsa not found !\" ;\n  test -f ${GETWAY_USER_CONF_PATH}/${LOGIN_USER}/getway.conf || error_exit \"配置文件不存在\" ;\n}\n\nfunction error_exit(){\n  local msg=$1\n  echo \"错误:$msg\"\n  exit 1 ; \n}\n\nfunction build(){\n  # @Param  authorized_keys file /home/${USER}/.ssh/${AUTH_KEY_NAME}\n  execMkdir /home/${LOGIN_USER}/.ssh\n  cat ${GETWAY_KEY_PATH}/${LOGIN_USER}/${AUTH_KEY_NAME}  > /home/${LOGIN_USER}/.ssh/${AUTH_KEY_NAME}\n  cat ${GETWAY_KEY_PATH}/manage/id_rsa  > /home/${LOGIN_USER}/.ssh/.secret_id_rsa\n  if [ -f ${GETWAY_KEY_PATH}/${LOGIN_USER}/id_rsa ] ; then\n     cat ${GETWAY_KEY_PATH}/${LOGIN_USER}/id_rsa  > /home/${LOGIN_USER}/.ssh/id_rsa\n     chmod 600 /home/${LOGIN_USER}/.ssh/id_rsa\n  fi\n\n  chown -R ${LOGIN_USER} /home/${LOGIN_USER}\n  chmod 600 /home/${LOGIN_USER}/.ssh/${AUTH_KEY_NAME}\n  chmod 600 /home/${LOGIN_USER}/.ssh/.secret_id_rsa\n}\n\n#代码开始\n\n# 读取全局配置项\nconfig ;\n# 检查执行用户是否为root\ncheckRoot ;\ndoParam $@ ;\n# 配置账户\naccount_add ;\nbuild ;',0,1,'2018-06-06 11:40:40','2018-06-08 03:04:31'),(10,'shadowsocks_service','shadowsocks启动服务',2425,'liangjian','#!/bin/bash\n/etc/init.d/shadowsocks restart',0,1,'2018-06-11 05:02:48','2018-12-20 11:07:22'),(11,'playbook-ss.yml','ss的自动化playbook',2407,'baiyi','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: Copy file \n      copy: src={{ src }} dest={{ dest }} owner=root group=root \n      notify:\n       - restart service\n  handlers:  \n    - name: restart service\n      service: name=shadowsocks state=restarted',0,1,'2018-12-26 06:09:46','2018-12-27 00:44:55'),(12,'playbook-ansible-host.yml','同步主机配置文件',2407,'baiyi','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: Copy file \n      copy: src={{ src }} dest={{ dest }} owner=root group=root',0,1,'2018-12-27 02:15:09','2018-12-27 02:15:59'),(13,'init_nginx_conf.yml','初始化nginx配置文件',2410,'xujian','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: mkdir nginx conf\n       shell: mkdir -p /data/nginx/conf\n    - name: mkdir nginx logs\n       shell: mkdir -p /data/nginx/logs\n    - name: mkdir nginx logs\n       shell: mkdir -p /data/nginx/logs/{{ item }}\n       with_items:\n          - buy.51bushou.com\n          - buy.myzebravip.com\n          - cart.51bushou.com\n          - cart.myzebravip.com\n          - cashier-desk.51bushou.com\n          - cashier-desk.myzebravip.com\n          - cmsapi.51bushou.com\n          - cmsapi.myzebravip.com\n          - member-benefits.myzebravip.com\n          - orderbuyer.51bushou.com\n          - orderbuyer.myzebravip.com\n          - prodapi.51bushou.com\n          - prodapi.myzebravip.com\n          - promotion.51bushou.com\n          - promotion.myzebravip.com\n          - refund.51bushou.com\n          - refund.myzebravip.com\n    - name: Copy nginx conf\n      copy: src={{ src }} dest={{ dest }} owner=root group=root\n    - name: chown\n       shell: chown -R www:www /data/nginx',0,0,'2019-01-11 08:14:37','2019-01-11 08:22:01'),(14,'playbook-nginx.yml','自动化配置nginx',2407,'baiyi','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: Copy file \n      copy: src={{ src }} dest={{ dest }} owner=root group=root  \n      notify:\n       - reloaded service\n    - name: get ps\n      shell: ps -ef|grep nginx|grep -v grep\n      register: psInfo\n    - name: show ps\n      debug: msg=\"{{ psInfo }}\"\n  handlers:  \n    - name: reloaded service\n      shell: /etc/init.d/nginx reload',0,1,'2019-01-14 00:41:17','2019-01-21 02:20:22'),(15,'playbook-dnsmasq.yml','dnsmasq自动配置',2407,'baiyi','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: Copy file \n      copy: src={{ src }} dest={{ dest }} owner=root group=root  \n      notify:\n       - reloaded service\n    - name: get ps\n      shell: ps -ef|grep dnsmasq|grep -v grep\n      register: psInfo\n    - name: show ps\n      debug: msg=\"{{ psInfo }}\"\n  handlers:  \n    - name: reloaded service\n      shell: /etc/init.d/dnsmasq restart',0,1,'2019-01-21 06:41:34','2019-01-21 10:55:35'),(16,'install_zabbix_agent.yml','安装zabbix_agent',2410,'xujian','---\n- hosts: \"{{ hosts }}\"\n  remote_user: root\n  vars:\n     zabbix_rpm_name_centos7: zabbix-release-4.0-1.el7.noarch.rpm\n     zabbix_rpm_name_centos6: zabbix-release-4.0-1.el6.noarch.rpm\n  tasks:\n    - name: download rpm for centos7\n      shell: cd /root && wget -O {{ zabbix_rpm_name_centos7 }} res.ops.yangege.cn/res/zabbix/{{ zabbix_rpm_name_centos7 }}\n      when: ansible_distribution == \"CentOS\" and ansible_distribution_major_version == \"7\"\n    - name: rpm -ivh rpm for centos7\n      yum: name=/root/{{ zabbix_rpm_name_centos7 }} state=present\n      when: ansible_distribution == \"CentOS\" and ansible_distribution_major_version == \"7\"\n    - name: download rpm for centos6\n      shell: cd /root && wget -O {{ zabbix_rpm_name_centos6 }} res.ops.yangege.cn/res/zabbix/{{ zabbix_rpm_name_centos6 }}\n      when: ansible_distribution == \"CentOS\" and ansible_distribution_major_version == \"6\"\n    - name: rpm -ivh rpm for centos6\n      yum: name=/root/{{ zabbix_rpm_name_centos6 }} state=present\n      when: ansible_distribution == \"CentOS\" and ansible_distribution_major_version == \"6\"\n    - name: yum install zabbix-agent\n      yum: name=zabbix-agent state=latest\n    - name: service zabbix-agent chkconfig on\n      service: name=zabbix-agent enabled=yes\n    - name: download zabbix-agent\n      shell: cd /etc/zabbix/zabbix_agentd.d && wget -O disk_name.py res.ops.yangege.cn/res/zabbix/disk_name.py && chmod +x disk_name.py\n    - name: chown zabbix\n      shell: chown -R zabbix.zabbix /etc/zabbix/zabbix_agentd.d/\n    - name: download zabbix-agent conf\n      shell: cd /etc/zabbix && wget -O zabbix_agentd.conf res.ops.yangege.cn/res/zabbix/zabbix_agentd.conf\n    - name: restart zabbix-agent service\n      service: name=zabbix-agent state=restarted',0,0,'2019-01-22 07:36:11','2019-02-15 08:20:15'),(17,'playbook-test.yml','Playbook测试',2407,'baiyi','---\n- hosts: \"{{ hosts }}\"\n  tasks:\n    - name: test\n      shell: w',0,1,'2019-01-23 06:28:24','2019-01-23 12:04:29'),(18,'change_DNS.yml','修改DNS',2410,'xujian','---\n- hosts: \"{{hosts}}\"\n  remote_user: root\n  tasks:\n    - name: add DNS1\n      lineinfile:\n        dest:  /etc/sysconfig/network-scripts/ifcfg-eth0\n        state: present\n        regexp: \'^DNS1\'\n        line: \'DNS1=192.168.0.58\'\n      ignore_errors: yes\n    - name: add DNS2\n      lineinfile:\n        dest:  /etc/sysconfig/network-scripts/ifcfg-eth0\n        state: present\n        regexp: \'^DNS2\'\n        line: \'DNS1=192.168.10.78\'\n      ignore_errors: yes',0,0,'2019-01-24 07:18:30',NULL);
